// Log that the file is being skipped (no changes detected)
for (const item of $input.all()) {
  console.log(`Skipping file: ${item.json.name || 'Unknown'} - No changes detected`);
}

// Return all input items unchanged
return $input.all();

const items = $input.all();



for (const [index, item] of $input.all().entries()) {
  item.binary = $("Download file").itemMatching(index).binary;
}

return items;

// Reload binary from Google Drive for upload (second reload)
const fileId = $json.id;

// Re-download file
const requestOptions = {
  method: 'GET',
  url: `https://www.googleapis.com/drive/v3/files/${fileId}?alt=media`,
  encoding: null,
  json: false
};

const binaryData = await this.helpers.httpRequestWithAuthentication.call(
  this,
  'googleDriveOAuth2Api',
  requestOptions
);

return {
  json: $json,
  binary: {
    data: await this.helpers.prepareBinaryData(
      Buffer.from(binaryData),
      $json.file_name
    )
  }
};

