function transformOfficialStatement(data, options = {}) {
  const documentId = options.documentId || makeDocumentIdFromTitle(data.document_title);

  const result = {};

  // ---- Helpers ----

  const toNumber = (v) => (v === null || v === undefined || v === "" ? null : Number(v));

  const parsePercent = (v) => {
    if (v === null || v === undefined || v === "") return null;
    return Number(String(v).replace("%", ""));
  };

  const parsePrice = (v) => {
    if (v === null || v === undefined || v === "") return null;
    // Drop trailing 'C' if present (callable)
    return Number(String(v).replace("C", ""));
  };

  function makeDocumentIdFromTitle(title) {
    if (!title) return "doc_" + Date.now();
    return title
      .toUpperCase()
      .replace(/[^A-Z0-9]+/g, "_")
      .replace(/^_+|_+$/g, "")
      .slice(0, 128);
  }

  // ---- bond_document ----

  result.bond_document = {
    document_id: documentId,
    document_title: data.document_title || null,
    school_district_name: data.school_district_name || null,
    county: data.county || null,
    state: data.state || null,
    overall_rating: data.overall_rating || null,
    overall_rating_agency: data.overall_rating_agency || null,
    overall_due_date: data.overall_due_date || null,
    date_bond_closes: data.date_bond_closes || null,
    date_of_delivery: data.date_of_delivery || null,
    interest_payment_description: data.interest_payment_dates || null,
    interest_commencing_date: data.interest_commencing_date || null,
    superintendent: data.superintendent || null
  };

  // ---- professional_services ----

  const ps = data.professional_services || {};
  result.professional_services = {
    document_id: documentId,
    legal_counsel: ps.legal_counsel || null,
    disclosure_counsel: ps.disclosure_counsel || null,
    financial_advisor: ps.financial_advisor || null,
    paying_agent: ps.paying_agent || null
  };

  // ---- financial_management_contact ----

  const fmc = data.financial_management_contact || {};
  result.financial_management_contact = {
    document_id: documentId,
    name: fmc.name || null,
    title: fmc.title || null,
    address: fmc.address || null,
    phone: fmc.phone || null
  };

  // ---- assessed_valuation_summary ----

  const avs = data.assessed_valuation_summary || {};
  result.assessed_valuation_summary = {
    document_id: documentId,
    fiscal_year: avs.fiscal_year || null,
    total_assessed_valuation: toNumber(avs.total_assessed_valuation),
    valuation_source: avs.valuation_source || null,
    is_county_teeter_plan_participant: Boolean(avs.is_county_teeter_plan_participant),
    notes: avs.notes || null
  };

  // ---- estimated_sources_uses & children ----

  const esu = data.estimated_sources_and_uses || {};
  result.estimated_sources_uses = {
    document_id: documentId,
    total_sources: toNumber(esu.total_sources),
    total_uses: toNumber(esu.total_uses)
  };

  result.estimated_source_issue = (esu.sources_by_issue || []).map((s) => ({
    document_id: documentId,
    issue: s.issue || null,
    principal_amount: toNumber(s.principal_amount),
    net_original_issue_premium: toNumber(s.net_original_issue_premium),
    total: toNumber(s.total)
  }));

  result.estimated_use_category = (esu.uses_by_category || []).map((u) => ({
    document_id: documentId,
    category: u.category || null,
    total_amount: toNumber(u.total_amount),
    measure_vv_amount: toNumber(u.measure_vv_amount),
    measure_m_amount: toNumber(u.measure_m_amount)
  }));

  // ---- redemption_date ----

  result.redemption_date = (data.redemption_dates || []).map((d) => ({
    document_id: documentId,
    redemption_date: d || null
  }));

  // ---- underwriter ----

  result.underwriter = (data.underwriters || []).map((u) => ({
    document_id: documentId,
    name: u.name || null
  }));

  // ---- board_member ----

  result.board_member = (data.board_of_education || []).map((m) => ({
    document_id: documentId,
    name: m.name || null,
    role: m.role || null
  }));

  // ---- debt_service_issue & debt_service_entry (top-level) ----

  const dss = data.debt_service_schedule || [];

  result.debt_service_issue = dss.map((issueObj) => ({
    document_id: documentId,
    issue_name: issueObj.issue || null
  }));

  // For entries, we keep issue_name; your loader can resolve to debt_service_issue_id
  result.debt_service_entry = dss.flatMap((issueObj) => {
    const issueName = issueObj.issue || null;
    return (issueObj.schedule || []).map((row) => ({
      // debt_service_issue_id will be filled in later, after inserting debt_service_issue
      issue_name: issueName,
      period_ending: row.period_ending || null,
      principal: toNumber(row.principal),
      interest: toNumber(row.interest),
      total_debt_service: toNumber(row.total_debt_service)
    }));
  });

  // ---- bond_issue ----

  const bondIssues = data.bond_issues || [];

  result.bond_issue = bondIssues.map((b) => ({
    document_id: documentId,
    bond_amount: toNumber(b.bond_amount),
    election_year: b.election_year ? Number(b.election_year) : null,
    bond_type: b.bond_type || null,
    bond_series: b.bond_series || null,
    rating: b.rating || null,
    due_date: b.due_date || null,
    interest_commencing_date: b.interest_commencing_date || null,
    base_cusip: (b.maturity_schedule && b.maturity_schedule.base_cusip) || null,
    optional_call_date: (b.redemption_policy && b.redemption_policy.optional_call_date) || null,
    maturities_callable_after: (b.redemption_policy && b.redemption_policy.maturities_callable_after) || null,
    redemption_price: (b.redemption_policy && b.redemption_policy.redemption_price) || null
  }));

  // ---- bond_maturity ----

  // We keep bond_series to resolve to bond_issue_id later
  result.bond_maturity = bondIssues.flatMap((b) => {
    const bondSeries = b.bond_series || null;
    const maturities = (b.maturity_schedule && b.maturity_schedule.maturities) || [];
    return maturities.map((m) => ({
      bond_series: bondSeries,
      maturity_date: m.maturity_date || null,
      principal_amount: toNumber(m.principal_amount),
      interest_rate: parsePercent(m.interest_rate),
      yield: parsePercent(m.yield),
      price: parsePrice(m.price),
      cusip: m.cusip || null
    }));
  });

  // ---- bond_issue_debt_service (from nested schedules under bond_issues) ----

  result.bond_issue_debt_service = bondIssues.flatMap((b) => {
    const bondSeries = b.bond_series || null;
    const sched = b.debt_service_schedule || [];
    return sched.map((row) => ({
      bond_series: bondSeries,
      period_ending: row.period_ending || null,
      principal: toNumber(row.principal),
      interest: toNumber(row.interest),
      total_debt_service: toNumber(row.total_debt_service)
    }));
  });

  return result;
}

